import "./VcanciesItem.css"
import moment from "moment";


const VacanciesItem =({vac,department,vacancies})=> {
    console.log('vac=',vac)
    const date = moment().format('YYYY-MM-DD');

    return (
        <>
            <div className="angry-grid1">
                <div id="item-01">{department}</div>
                {vacancies.map(vac => (
                    <div key={vac.id}>
                        <div id="item-11">{date === vac.create_date ? 'NEW' : ''}</div>
                        <div id="item-21">{vac.name}</div>
                        <div id="item-31">{vac.user_name}</div>
                        <div id="item-41">{moment(vac.create_date).format('DD.MM.YYYY')}</div>
                    </div>
                ))}
            </div>
        </>
    )
}

export default VacanciesItem
